import PageTemplate from './PageTemplate';
import TodoInput from './TodoInput';
import TodoList from './TodoList';

class App extends Component {
    state = {
        input: ''
    }
    render() {
        const { input } = this.state;
        return(
            <PageTemplate>
                <TodoInput />
                <TodoList />
            </PageTemplate>
        );
    }
}

export default App;
